import React from 'react';
import MovieDetails from './pages/MovieDetails'
import NewMovie from './pages/NewMovie'
import EditMovie from './pages/EditMovie'
import MoviesList from './pages/MovieList'
import NotFound from './pages/NotFound'
import{BrowserRouter , Router ,Switch} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <Switch>
    <Router>
    <div>Movie Card Library CRUD</div>
    </Router>
    <Router exact path="/"  component={MoviesList}/>
    <Router path="/movies/:id" render={props => <MovieDetails {...props} />} />
    <Router path="/movies/new" component={NewMovie} />
    <Router path="/movies/:id/edit" render={props =><EditMovie {...props} />}  />
    <Router path="*" component={NotFound} />
    </Switch>
    </BrowserRouter>
  );
}

export default App;
